      "content": "// SPDX-License-Identifier: BUSL-1.1
pragma solidity 0.8.21;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/Address.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

contract Treasury is Ownable, ReentrancyGuard {
    using SafeERC20 for IERC20;
    using EnumerableSet for EnumerableSet.AddressSet;

    struct FeeReceiverData {
        address receiver;
        uint256 percent;
    }

    uint256 public constant DIVIDER = 1e18;
    address public keeper;
    EnumerableSet.AddressSet private _receivers;
    mapping(address => uint256) private _percents;

    function receivers(uint256 index) external view returns (address) {
        return _receivers.at(index);
    }

    function receiversCount() external view returns (uint256) {
        return _receivers.length();
    }

    function receiversContains(address receiver) external view returns (bool) {
        return _receivers.contains(receiver);
    }

    function receiversPercent(address receiver) external view returns (uint256) {
        return _percents[receiver];
    }

    event FeeReceiversUpdated(FeeReceiverData[] receivers);
    event TreasuryClaimed(address indexed token, address indexed receiver, uint256 amount);

    error UpdateFeeReceiversReceiverZero();
    error UpdateFeeReceiversPercentSumDiffers(uint256 sum, uint256 target);
    error UpdateFeeReceiversDuplicatedData();
    error ClaimTreasuryTokenBalanceZero(address token);
    error CallerNotKeeper(address caller, address keeper);
    error KeeperZero();

    constructor(FeeReceiverData[] memory data, address keeper_) Ownable(msg.sender) {
        _updateFeeReceivers(data);
        if (keeper_ == address(0)) revert KeeperZero();
        keeper = keeper_;
    }

    receive() external payable {}

    function claimTreasury(address[] memory tokens) external nonReentrant returns (bool) {
        if (msg.sender != keeper) revert CallerNotKeeper(msg.sender, keeper);
        for (uint256 j = 0; j < tokens.length; j++) {
            address token = tokens[j];
            uint256 balance = token == address(0) ? address(this).balance : IERC20(token).balanceOf(address(this));
            if (balance == 0) revert ClaimTreasuryTokenBalanceZero(token);
            uint256 amountSum = 0;
            uint256 receiversLength = _receivers.length();
            for (uint256 i = 0; i < receiversLength; i++) {
                address receiver = _receivers.at(i);
                uint256 amount = i != receiversLength - 1
                    ? (balance * _percents[receiver]) / DIVIDER
                    : balance - amountSum;
                amountSum += amount;
                if (token == address(0)) Address.sendValue(payable(receiver), amount);
                else IERC20(token).safeTransfer(receiver, amount);
                emit TreasuryClaimed(token, receiver, amount);
            }
        }
        return true;
    }

    function updateFeeReceivers(FeeReceiverData[] memory data) external onlyOwner returns (bool) {
        _updateFeeReceivers(data);
        return true;
    }

    function _updateFeeReceivers(FeeReceiverData[] memory data) private {
        if (_receivers.length() > 0) {
            for (uint256 i = _receivers.length() - 1; i >= 0; i--) {
                _receivers.remove(_receivers.at(i));
                if (i == 0) break;
            }
        }
        uint256 percentSum = 0;
        for (uint256 i = 0; i < data.length; i++) {
            FeeReceiverData memory receiverData = data[i];
            if (receiverData.receiver == address(0)) revert UpdateFeeReceiversReceiverZero();
            _receivers.add(receiverData.receiver);
            _percents[receiverData.receiver] = receiverData.percent;
            percentSum += receiverData.percent;
        }
        if (percentSum != DIVIDER) revert UpdateFeeReceiversPercentSumDiffers(percentSum, DIVIDER);
        if (_receivers.length() != data.length) revert UpdateFeeReceiversDuplicatedData();
        emit FeeReceiversUpdated(data);
    }
}
